import React from "react";
import { useEffect } from "react";

const comidas=[
    {
        "id":1,
        "nombre":"Milanesa",
        "precio":"TUCULO"
    },
    {
        "id":2,
        "nombre":"Empanada",
        "precio":"TUCULO"
    },
    {
        "id":3,
        "nombre":"Tortilla",
        "precio":"TUCULO"
    }


]

function Comida(){
    
        const  crearLista= function(){
      
        comidas.map(item=>{
            var nombre=item.nombre;
            var precio=item.precio;
           var Lista=<ul> <li>
                 <h2>{nombre}</h2>
                 <h3>{precio}</h3>
          </li>
          </ul>
          return Lista;
        })
    
    return  (
        <>
       {Lista}
        
        </>
    )
}
}

export default Comida;
